import React from 'react';
import Home from './Components/Home';
import Product from './Components/Product';
import Services from './Components/Services';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App" style={{ textAlign: "center" }}>
      <h1 style={{ textAlign: "center", color: "GrayText" }}>This application is an example of React Router.</h1>
      <Router>
        <div className='navbar'>
          <nav>
            <ul style={{ listStyleType: "none", display: "flex", justifyContent: "center" }}> {/* Apply flexbox styles to the ul */}
              <li style={{ margin: "0 10px" }}> {/* Apply margin between list items */}
                <Link to='/Home'>Home</Link>
              </li>
              <li style={{ margin: "0 10px" }}>
                <Link to='/Product'>Product</Link>
              </li>
              <li style={{ margin: "0 10px" }}>
                <Link to='/Services'>Services</Link>
              </li>
              {/* Add a new list item */}
              <li style={{ margin: "0 10px" }}>
                <Link to='/About'>About</Link>
              </li>
            </ul>
          </nav>

          <Routes>
            <Route path='/Home' element={<Home />} />
            <Route path='/Product' element={<Product />} />
            <Route path='/Services' element={<Services />} />
            {/* Add a route for the new link */}
            <Route path='/About' element={<About />} />
          </Routes>

        </div>
      </Router>
    </div>
  );
}

// Dummy About component for demonstration
const About = () => {
  return (
    <div>
      <h2>About Us</h2>
      <p>This is the About Us page.</p>
    </div>
  );
};

export default App;
